uploadtext:
 Файлъёсты инъян понна кутэ улӥяз сётэм кабез.
Азьвыл инъям файлъёсты учкон яке шедьтон понна выже
 [[Special:FileList|инъям файлъёслэн лыдъетсы]]. Инъянъёс но кыкетсэ инъянъёс озьы ик гожтӥсько [[Special:Log/upload|инъян журналэ]].  Ӵушонъёс гожтӥсько  [[Special:Log/delete| ӵушонъёсын журналэ]].
Файлэз баме лэзён понна, чӧлсконэз огезъя сётэм кабъя кутэ:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong>, файллэсь быдэсак пӧртэмлыксэ уже кутон понна; 
*<strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></ strong>, пасьталаезъя 200 пиксель тыр тусъетэз гожтослэн паллян палаз, солэн улаз кылсуред пуктыса, кутон понна;   
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> файллэсь пуштроссэ адӟытэк, со вылэ шонерак сюрон понна;
